import { Component } from "react";

export class Form extends Component {
  state = {
    name: "",
  };
  handleNameChange = (event) => {
    this.setState({ name: event.currentTarget.value });
  };
  render() {
    return (
      <form>
        <label>
          <input
            type="text"
            placeholder="name"
            onChange={this.handleNameChange}
            value={this.state.name}
          />
        </label>
      </form>
    );
  }
}
